import React from "react"
import Symbols from "./Symbols"
import './style.css';
import './desktop.css'
import ParticleBackground from "./ParticleBackground"

function Desktop() {
  return (
    <div id="desktop">
      <ParticleBackground id="particles" z-index="10000"/>
      <div class="Symb">
        <Symbols draggable="true" title= "Spotify" icon= ""/> 
        <Symbols draggable="true" title= "Instagram" icon= ""/>
        <Symbols draggable="true" title= "Vids" icon= ""/>
        <Symbols title= "Pics" icon= ""/>
      </div>
    </div>
  );
}

export default Desktop;
